css:
@-moz-document url("http://www.google.com/"), url("https://www.google.com/") {
  #lga:after {
    content: "/*[[country]]*/";
    color: rgb(119, 119, 119);
    font-size: 16px;
    font-weight: bold;
    position: relative;
    left: -61px; top: -9px;
  }
}
@-moz-document regexp("https?://www\.google(\.com?)?\.[a-z][a-z]/") {
  #hplogo > DIV {font-size: 0 !important}
  #hplogo > DIV:after {
    content: "/*[[country]]*/";
    color: rgb(119, 119, 119);
    font-size: 16px;
    font-weight: bold;
    position: relative;
/*    left: -61px; top: -9px;*/
  }
}
